# This function creates a DI output of type message (api.Message) emulating the <SLT Connector> operator
# input ports:  None
# output ports: "output" - type message - full SLT payload (metadata and csv content)
#               "ABAP" - type string - writes out the ABAP part of the metadata dictionary
def slt_conn_generator() :
    global repmode
    # Check config of which type of replication
    repmode = api.config.replicationmode
    # local Counter
    if not hasattr(slt_conn_generator, "counter"):
        slt_conn_generator.counter = 0
    
    if slt_conn_generator.counter == 0 :
        attr = json.loads(s_attr)
        l_body = s_body_2 if repmode == "Delta" else s_body
        abapcols = attr["ABAP"]
        abapfields = abapcols["Fields"]
        api.send("ABAP", f"\nReplication mode = {repmode}")
        api.send("ABAP", json.dumps(abapfields, indent=2))
        api.send( "ABAP", "\nSample output -")
        api.send("ABAP", "100,000000003000000056,4215,TEST_14,1,1999914255,5,X,,00000000000000000000000000000000,0,E150,005056A87B281ED69E9FADBE4494354F,005056A87B281ED69E9FADBE4494754F,PDI,00000000000000000000000410000000709,10,,00000000000000000000000000000000,,,,,0,0,,,9999-99-99,00:00:00.000,9999-99-99,00:00:00.000,ZEWM_SCWM_TU_DLV,U")
        api.send("output", api.Message(attributes=attr, body= l_body))
    elif repmode == "Initial" :
        api.send("ABAP", "Replication mode = Initial, Sending lastBatch = True")
        attr = json.loads(s_attr_last)
        l_body = ''
        api.send("output", api.Message(attributes=attr, body= l_body))
    elif repmode == "Replication" :
        api.send("ABAP", "Replication mode = Replication, Sending Rows to be updated")
        attr = json.loads(s_attr)
        attr["message.batchIndex"] = slt_conn_generator.counter
        l_body = s_body_2
        api.send("output", api.Message(attributes=attr, body= l_body))

    slt_conn_generator.counter += 1


# Run once
